import React, {useState} from 'react';

import datePick from './Date.js'

import { Input } from '@material-ui/core';


function Form() {

  const [name, setName] = useState('');
  const [value, onChange] = useState(new Date());

  datePick()
  return (
    <div>
      <Input 
        placeholder='Name' 
        value={name}
        onChange={e=>setName(e.target.value)} 
      />
      <DatePicker
        onChange={onChange}
        value={value}
      />
    </div>
  );
}

export default Form
